INSERT INTO `quotes` VALUES(3328, 17335, '&lt;Balatro&gt; Electroly:&nbsp; It died on me once and wouldn''t restart.&nbsp; I had to ps -aux or whatever the fuck it is and kill the process.&nbsp; Then it started fine.<br />\r\n&lt;Electroly&gt; ah, nothing good old `ps aux | grep Proteus | awk ''{print $2 }'' | xargs kill -9` won''t fix.<br />\r\n&lt;Electroly&gt; much better, that worked.<br />\r\n* Gandalf stares at Electroly <br />\r\n&lt;Gandalf&gt; And I thought I was a Unix dork. <br />\r\n&lt;Balatro&gt; Yeah, it was so much less effort to do that then to type a command, quickly see the process and kill it by PID :)<br />\r\n&lt;Electroly&gt; you are a unix dork<br />\r\n&lt;Electroly&gt; Balatro: there were like 10 Proteus processes, dude.<br />\r\n&lt;Balatro&gt; Funny, I had 1 ;)<br />\r\n&lt;Electroly&gt; dunno where these all came from, but i killed them all.<br />\r\n&lt;Electroly&gt; now all is well<br />\r\n&lt;Gandalf&gt; Electroly: I understand ps, grep, and xargs. Explain how that awk thinger works, though? :) <br />\r\n&lt;Electroly&gt; Gandalf: awk is pretty simple.&nbsp; it treats the stdin as a bunch of columns<br />\r\n&lt;Electroly&gt; and lets you reformat the output.&nbsp; { print $n } is typical, where n is the column number to print out.<br />\r\n&lt;kurros&gt; AWK AWK MOTHER FUCKER<br />\r\n&lt;Electroly&gt; it uses whitespace as the column delimiter by default, but you can change that by some argument to it<br />\r\n&lt;Gandalf&gt; ah, and in ps aux the PID is the second column, thus $2, right? <br />\r\n&lt;Electroly&gt; yup<br />\r\n&lt;Electroly&gt; you can do other stuff with awk, like awk ''{ print &quot;Whee!&nbsp; The PID for &quot; $10 &quot; is &quot; $2 &quot;!&quot; }''<br />\r\n&lt;Balatro&gt; It makes me hot when you talk unix.<br />\r\n&lt;Electroly&gt; rm -rf /home/Balatro<br />\r\n&lt;Balatro&gt; That''s /homo/Balatro, honey :)', 165);
