INSERT INTO `quotes` VALUES(8864, 233331, '&lt;jamesd&gt; &quot;... being a Linux user is sort of like living in a house inhabited by a large family of carpenters and architects. Every morning when you wake up, the house is a little different. Maybe there is a new turret, or some walls have moved. Or perhaps someone has temporarily removed the floor under your bed.&quot;<br />\r\n* kop_ (~2@sdn-ap-019watacoP0124.dialsprint.net) has joined #solaris<br />\r\n&lt;sheenmaster&gt; jamesd: being an OpenServer or UNIXWare user is like living in a house that hasn''t been touched by a carpenter or inspected by an architect in years.&nbsp; Every morning when you wake up, the neighbor''s house is a little better.&nbsp; You are justing thankful that the floor hasn''t fallen out from beneath your bed, cause you know it''ll be half a decade before its fixed.<br />\r\n* RainbowW has quit (Read error: 54 (Connection reset by peer))<br />\r\n&lt;sheenmaster&gt; jamesd: being a Windows user is like living is a cheap vegas hotel.&nbsp; Every morning, you wake up with a new disease.&nbsp; The floor beneath your bed is likely to fall through at any time, but at least you can burn the hotel down and rebuild it or move to another room.<br />\r\n&lt;jamesd&gt; &quot;Memory is like gasoline. You use it up when you are running. Of course you get it all back when you reboot...&quot;<br />\r\n&lt;jamesd&gt;&nbsp; -- Actual explanation obtained from the Micro$oft help desk. <br />\r\n&lt;sheenmaster&gt; haha<br />\r\n&lt;sheenmaster&gt; Damn Microsoft for coming up with better jokes than we do!', 1157);
