INSERT INTO `quotes` VALUES(9974, 522860, '&lt;prepared&gt;Theorem: All numbers are equal.<br />\r\n&lt;prepared&gt;Proof: Choose arbitrary a and b, and let t = a + b. Then<br />\r\n&lt;prepared&gt;a + b = t<br />\r\n&lt;prepared&gt;(a + b)(a - b) = t(a - b)<br />\r\n&lt;prepared&gt;a^2 - b^2 = ta - tb<br />\r\n&lt;prepared&gt;a^2 - ta = b^2 - tb<br />\r\n&lt;prepared&gt;a^2 - ta + (t^2)/4 = b^2 - tb + (t^2)/4<br />\r\n&lt;prepared&gt;(a - t/2)^2 = (b - t/2)^2<br />\r\n&lt;prepared&gt;a - t/2 = b - t/2<br />\r\n&lt;prepared&gt;a = b<br />\r\n&lt;prepared&gt;So all numbers are the same, and math is pointless.', 270);
