INSERT INTO `quotes` VALUES(10807, 695338, '[ Pwyff ] So one day, George Bush and The Queen of England are sitting in her room talking about politics, when Bush asks the Queen, &quot;How do you know if the highest members of your state are smart enough to be doing their job?&quot;<br />\r\n[ Pwyff ] And the Queen replies, &quot;Well, I usually ask them riddles, and see how fast they respond. That''s usually a good way to see if they can think for themselves.&quot;<br />\r\n[ Pwyff ] So the Queen calls Tony Blair in, and asks him, &quot;If your Parents had a child, but it''s not your sister, and it''s not your brother, who is it?&quot;<br />\r\n[ Pwyff ] And Tony Blair immediately replies, &quot;That''s easy, it''s me!&quot;<br />\r\n[ Pwyff ] And the Queen, who is very pleased, send Tony Blair away.<br />\r\n[ Pwyff ] Now, Bush, who is very impressed, brings the Queen to find Donald Rumsfield and asks him, &quot;Hey Donald, if your parents had a kid, but it''s not your sister, and it''s not your brother, who is it?&quot;<br />\r\n[ Pwyff ] And Rumsfield ponders for a long time, and then admits to Bush that he has no clue.<br />\r\n[ Pwyff ] Pissed off, Bush drags Rumsfield and the Queen to Dick Cheney, where Bush asks Cheney, &quot;Hey Dick, if your parents had a kid, but it''s not your sister or your brother, who is it?&quot;<br />\r\n[ Pwyff ] And Cheney ponders for a long time, and then he finally lights up with an idea, and says &quot;It''s me!&quot;<br />\r\n[ Pwyff ] And Bush gets REALLY pissed off, and yells at both of them, &quot;NO YOU IDIOTS! IT''S TONY BLAIR!&quot;', -929);
