INSERT INTO `quotes` VALUES(10889, 750735, '&lt;[Faer|eggs]&gt; oh yeah, Easter<br />\r\n&lt;[Faer|eggs]&gt; which means I will have baskets of chocolate to go with my bucket of candy and can of DIET soda<br />\r\n&lt;LoneSamurai&gt; hahaha<br />\r\n&lt;Tremens&gt; well<br />\r\n&lt;Tremens&gt; you have to watch to make sure you dont get fat<br />\r\n&lt;Tremens&gt; hence the diet soda<br />\r\n&lt;[Faer|eggs]&gt; This reminds me of a related, true, and funny story<br />\r\n&lt;LoneSamurai&gt; uh oh, everyone run, here comes a Faer story<br />\r\n&lt;Akuma&gt; be less bitter lone<br />\r\n&lt;Akuma&gt; faer stories are really good<br />\r\n&lt;LoneSamurai&gt; hahaha<br />\r\n&lt;LoneSamurai&gt; if your 13<br />\r\n&lt;[Faer|eggs]&gt; When I worked at BK there was this woman who would regularly come to my DRIVE-THRU window and order a Whopper, an Angus Steak Burger, Double Bacon Cheeseburger value meal, large Chocolate shake, large onion rings, lots of sauce, and a DIET coke<br />\r\n&lt;[Faer|eggs]&gt; Each and every time, when I would hand her the order, she''d make a fuss &quot;Are you sure this is DIET?&quot;<br />\r\n&lt;[Faer|eggs]&gt; So after about a month of this I finally got fed up with the whole thing<br />\r\n&lt;[Faer|eggs]&gt; And when she came for her daily visit, and threw the daily fuss, I said:<br />\r\n&lt;Tremens&gt; (this is where faer gers fired)<br />\r\n&lt;[Faer|eggs]&gt; &quot;No ma''am, I''m terribly sorry, we''re out of DIET coke today. Instead I filled your cup with water, some bacon grease, and a bit of leftover breakfast gunk from the cinnamon rolls. I know it sounds strange now, but trust me, when you drink it, it''ll taste just the same as the DIET coke does after you inhale all that fat and grease you order from me every day.&quot;<br />\r\n&lt;[Faer|eggs]&gt; So she asked if she could see my manager<br />\r\n&lt;Akuma&gt; ROFL<br />\r\n&lt;[Faer|eggs]&gt; Of course, I smiled, and walked away to get my manager<br />\r\n&lt;[Faer|eggs]&gt; Manager spoke to her a few moments, there were some harsh hand symbols, and eventually the woman drove off<br />\r\n&lt;[Faer|eggs]&gt; My manager came back to me with the most PISSED OFF look on her face<br />\r\n&lt;[Faer|eggs]&gt; And said &quot;That woman has been coming here for the past two years. She''s been our most loyal customer at this shop, and you just drove her away forever.&quot;<br />\r\n&lt;[Faer|eggs]&gt; The next day, I got a raise.<br />\r\n&lt;Tremens&gt; haha<br />\r\n&lt;[Faer|eggs]&gt; And that, my friends, is the end of my tale.', 1045);
