INSERT INTO `quotes` VALUES(10995, 762388, '&lt;Chrysalid^Revenge&gt; I had something like that happen to me once.<br />\r\n&lt;Chrysalid^Revenge&gt; And vengeance is a plate best served cold. <br />\r\n* Sectoid^Authopsy sits down for storytime<br />\r\n&lt;Chrysalid^Revenge&gt; I saw some asshole stealing my pack of cigarettes from my table while I was getting another beer.<br />\r\n&lt;Chrysalid^Revenge&gt; But of course, as I confronted him, he denied it flatly, and all the sudden four of his mates were getting ready for a fight and shit.<br />\r\n&lt;Chrysalid^Revenge&gt; So I decided to back down, and rather get one over him later.<br />\r\n&lt;Chrysalid^Revenge&gt; Of course, living in an army camp has it''s advantages, such as easy access to ammo.<br />\r\n&lt;Sectoid^Authopsy&gt; o_0<br />\r\n&lt;Chrysalid^Revenge&gt; So I took two Winner Tip cartridges, a little bit of tobacco, and quite a generous amount of gunpowder from a blank I ''obtained'', topping it off with tobacco to get a proper look.<br />\r\n&lt;Chrysalid^Revenge&gt; Next weekend, I leave my pack containing two cigs rather indiscreetly at my table when I see this assholes is at the pub, and go to pick up another beer. <br />\r\n&lt;Chrysalid^Revenge&gt; When I come back, the pack has vanished. So I get hold of one of the bouncers, telling him that I saw someone carrying &quot;what looked like fireworks around&quot;.<br />\r\n&lt;Chrysalid^Revenge&gt; Ten seconds later, there''s some nasty fizzing, a lot of smoke and a huge fucking flame coming from one of the corner tables, and seconds later, the same thing happens in the hand of one of the guys sitting there. <br />\r\n&lt;Chrysalid^Revenge&gt; And at this point, it has to be mentioned that watching two bouncers pull a screaming guy with no eyebrows left, and a nasty burn up half his face out of a pub, ''accidentally'' drop him down the stairs, and finally call the cops on him, does lead to a certain smugness.<br />\r\n&lt;Chrysalid^Revenge&gt; The morale is, don''t you ever fucking touch my cigarettes. I can probably spare you one if you ask, but fucking ask first, okay?!', 1643);
