INSERT INTO `quotes` VALUES(11232, 790133, '&lt;third_planet&gt; The other night my friend had some pot and wanted me to smoke it with him, but we had nowhere to smoke it because both our parents were home.<br />\r\n&lt;third-planet&gt; So we drove around looking for a place to park so we could smoke in the car.<br />\r\n&lt;third-planet&gt; We eventually settled on a Wendys parking lot..<br />\r\n&lt;Mr-Butlertron&gt; The logic is all there...<br />\r\n&lt;third-planet&gt; I know, it was a ridiculous idea. We were just desperate and that was the first place to pull off..<br />\r\n&lt;third-planet&gt; So we park in the back of the parking lot under this tree, and it''s dark out, so we figure we''re secluded enough. We start to light up and a cop pulls in. So we both sit really still and hope the cop will think the car is empty and just parked there. Or that he won''t notice.<br />\r\n&lt;third-planet&gt; The cop circles the parking lot once, then parks behind us and we''re both freaking out. So Bobby, my friend, takes all the pot and shoves it in the glove compartment. But the car smells like pot, so we figure we''re busted. <br />\r\n&lt;third-planet&gt; So Bobby says we''ve gotta distract the cop from the pot. In a huge flash, he rips his shirt off, undoes my pants and sticks his hand inside. Before I can process what''s happening, the cop knocks on my window. Then he looks in and sees Bobby shirtless, with his hand down my pants and turns bright red. <br />\r\n&lt;third-planet&gt; I roll my window down and the cop says in this really flustered voice, his face bright red, &quot;you guys be good now&quot; and walks quickly back to his car and drives off.<br />\r\n&lt;third-planet&gt; He didn''t even notice the smell of pot.<br />\r\n&lt;third-planet&gt; We drove home in the most uncomfortable fucking silence ever.', 11030);
