INSERT INTO `quotes` VALUES(11245, 794363, '&lt;Shovel&gt; I ran across the worst named person in the world today...<br />\r\n&lt;Shovel&gt; I''m sitting in the waiting room at my doctor''s office, waiting for a physical before I go off to college in a few weeks. <br />\r\n&lt;Shovel&gt; I''m a little early and there are other people in the waiting room so when the nurse comes out to call the next person I''m pretty sure it''s not me. <br />\r\n&lt;Shovel&gt; She walks out of the hallway, looks down at her clipboard and immediately turns around and goes back behind the door. <br />\r\n&lt;Shovel&gt; She''s obviously talking to some of the other nurses.<br />\r\n&lt;Shovel&gt; When she comes back about 30 seconds later, she looks at the clipboard, takes a deep breath and says: &quot;Shithead O''Neal, the doctor''s able to see you now.&quot;<br />\r\n&lt;Shovel&gt; A large black woman stands up quickly and yells in a surprsingly stereotypical black women voice &quot;IT''S PRONOUNCED SHAW-THEED!&quot; <br />\r\n&lt;Shovel&gt; She storms off after the nurse, who is apologizing very loudly and everyone in the waiting room just looks at each other and exchange a few laughs and snickers.', 1268);
INSERT INTO `quotes` VALUES(11246, 794379, '&lt;karlmex&gt; So a friend of mine got back from Amsterdam a few months back, after spending a stint there with a bunch of his mates.&nbsp; Told me quite possibly one of the funniest stories Ive heard. They had picked up some shrooms and acid, and decided to take it in the wee hours of the morning, and spend the day exploring the city while they trippedsure enough 20min into it, one of the group vanishes. So, after 7 or so hours of struggling to search for their lost friend, they decide itd be best to head back to their hotel, sober up, regroup, and go looking when the gears worn off and theyd be of more use.<br />\r\n&lt;tubs&gt; lol k<br />\r\n&lt;karlmex&gt; Anyway, upon arrival at the hotel, surprise suprise they find their friend standing in the lobby, dazed and staring at the ceiling muttering to himself.&nbsp; Understandably they were all pissed off with him for making them worry and bringing their trip down as a result of their half assed search. However all the friend can reply with is this fucking town is full of gremlins! They tried to calm him down and tell him that it was the acid making him hallucinate, to which he replied I knew youd say that so I captured one and locked it in the bathroom<br />\r\n&lt;tubs&gt; lol? <br />\r\n&lt;karlmex&gt; as youd expect they thought he was losing the plot, but he insisted they come to his room and look for themselves. So, they head to the room, and sure enough, the bathroom door is baracaded shut with chairs, lamps, mattress and the bedthey''re getting a little worried now, so they cautiously move the furniture away and inch the door open<br />\r\n&lt;tubs&gt; and??<br />\r\n&lt;karlmex&gt; ...Laying on the floor is a 10 year old kid with Down syndrome grinning ear to ear.<br />\r\n&lt;tubs&gt; lol dude that''s fucked up<br />\r\n&lt;karlmex&gt; The mate had come across one of those outing groups or retarded kids - freaked out, balled up one of those poor little bastards carried him back to the room and locked him in the bathroom for proof<br />\r\n&lt;tubs&gt; lol god man<br />\r\n&lt;karlmex&gt; anyway, luckily the kid had one of those ID cards saying hi my name is Ted, I live at blah blah lol so yea, took the poor kid to the lobby, called the cops and did a runner before they arrived lol.', 3132);
