INSERT INTO `quotes` VALUES(11352, 814698, '&lt;JayNiN&gt; So yeah, guys, my dad and I had a big arguement last night...It''s actually pretty fucking awkward.<br />\r\n&lt;SimCard&gt; Yeah? Tell us about.<br />\r\n&lt;JayNiN&gt; Heh, you guys aren''t going to believe this...but anyways.<br />\r\n&lt;JayNiN&gt; So last night, my sister was trying to get her AOL connection shut off (yes, I know...who the fuck still uses AOL?)<br />\r\n&lt;JayNiN&gt; and I decide to go to the regional chatrooms<br />\r\n&lt;JayNiN&gt; 10 minutes in the chatroom, some random guy IMs me and is like &quot;ASL&quot;<br />\r\n&lt;JayNiN&gt; so I fuck around with the guy saying &quot;19/F/WY&quot;<br />\r\n&lt;JayNiN&gt; The guy starts tripping out and is like &quot;omg, I''m from Wyoming!&quot; <br />\r\n&lt;JayNiN&gt; and so I''m like &quot;Oh, really? What part?&quot;<br />\r\n&lt;JayNiN&gt; the guy goes &quot;Cheyenne&quot;...I shit myself. I''m from Cheyenne!<br />\r\n&lt;JayNiN&gt; Out of nowhere, the guy asks for my phone number...so I was feeling a bit mischievious and I wanted to have my sister talk to him and then we would just prank the guy.<br />\r\n&lt;JayNiN&gt; Well, I give the guy my number and out of nowhere he goes...&quot;JAKE!? What the fuck!?&quot;<br />\r\n&lt;JayNiN&gt; I trip out and I''m like &quot;Who the hell are you? And how do you know my name/number!?&quot;<br />\r\n&lt;JayNiN&gt; and he goes &quot;GET THE FUCK HOME RIGHT NOW!&quot;<br />\r\n&lt;JayNiN&gt; It was my dad...', 1999);
INSERT INTO `quotes` VALUES(11353, 814739, '&lt;spinks&gt; I''m pretty sure dad is reconsidering sending me to drama classes<br />\r\n&lt;maguiness&gt; ?<br />\r\n&lt;maguiness&gt; explain<br />\r\n&lt;spinks&gt; well tonight i was home alone for most of the night. Mum was with my little brothers in singleton, out to dinner for my uncle''s birthday<br />\r\n&lt;spinks&gt; my older brother is in gloucester for the next few days<br />\r\n&lt;spinks&gt; and dad was at karate till about 8 and thus i had to cook tea<br />\r\n&lt;spinks&gt; of course i get a brilliant theatrical idea in my head just to make things a little awkward when dad comes home<br />\r\n&lt;spinks&gt; i cook some pretty basic fuckign stuff, 2 pies and some 2 minute noodles<br />\r\n&lt;spinks&gt; but i garnish the fuck out of them with salads and shit, and put them on the good china, got the good cutlery out, wine glasses filled with red wine, the dinenr candles, the nice place mats, all of it<br />\r\n&lt;spinks&gt; a nice romantic dinner<br />\r\n&lt;spinks&gt; dad got home and i lit the candles, got dressed in my suit and tie, nice saphire-blue micro-fibre shirt, placed the plates opposite one another and turned all the lights off<br />\r\n&lt;spinks&gt; I sat there waiting, folded my hands nicely and dad walked through the door, blinked coz of the low light and just stared at me<br />\r\n&lt;spinks&gt; then he just slowly walked to his room, where i''d laid a trail of fake rose petals down the hallway to his room<br />\r\n&lt;spinks&gt; GOD i will never forget the look on his face', 2181);
