INSERT INTO `quotes` VALUES(11418, 945317, '* gg (Mibbit@205.204.48.221) has joined #Terraria<br />\r\n&lt;gg&gt; I just cut my hand with a knife while slicing a hotdog.<br />\r\n&lt;@Sqozza&gt; Awesome.<br />\r\n&lt;gg&gt; It happened because the phone rang. When I answered it, it was this clown I know named Steve.<br />\r\n&lt;gg&gt; He told me he had been to a graveyard and seen my name on six gravestones.<br />\r\n&lt;gg&gt; When I hung up the phone, I was surprised to notice my hand dripping blood faster than I''d anticipated from such a small wound.<br />\r\n&lt;gg&gt; Concerned, I bandaged the hand with a paper napkin, but realized there was butter on the napkin, and the butter had salt in it.<br />\r\n&lt;gg&gt; So, with a stinging hand, I ran cold water over the hand but the butter made the water slough off.<br />\r\n&lt;gg&gt; Then the doorbell rang.<br />\r\n&lt;gg&gt; I answered it. It was Steve again. He was holding a package for me and standing at a strange angle.<br />\r\n&lt;gg&gt; I took the package and slammed the door.<br />\r\n&lt;gg&gt; Opening the package, I noticed two things. 1) The package was unaddressed, and 2) my hand was still bleeding.<br />\r\n&lt;@Sqozza&gt; 3) Steve is awesome.<br />\r\n&lt;gg&gt; I ripped the package open and inside were five rusted nails and a jack rabbit''s head.<br />\r\n&lt;gg&gt; I called Steve back, but he didn''t answer.<br />\r\n&lt;gg&gt; Confused and bleeding, I tossed the box into the trash and sat back down on the couch to finish Dr. Who.<br />\r\n&lt;TheBadShepperd&gt; I knew this was going to end bad when you said you knew a clown.<br />\r\n&lt;@Sqozza&gt; Clowns these days<br />\r\n&lt;gg&gt; But the episode was strange. It was about to short people fighting over a rotten piece of meat.<br />\r\n&lt;gg&gt; The Dr. was nowhere to be seen.<br />\r\n&lt;gg&gt; I got out a T.V. Guide to see if I was mistaken about what I''d TiVo''d.<br />\r\n&lt;@Sqozza&gt; gg, maybe you were watching Jersey Shore instead<br />\r\n&lt;gg&gt; I wasn''t. It was, indeed, Dr. Who. At least according to T.V. Guide.<br />\r\n&lt;gg&gt; I put the remote down and noticed that my hand was still bleeding.<br />\r\n&lt;gg&gt; Then I ate my hotdog.<br />\r\n&lt;gg&gt; Slowly.<br />\r\n* gg (Mibbit@205.204.48.221) has left #Terraria<br />\r\n&lt;@Sqozza&gt; What the fuck just happened', 227);
